// src/pages/UserDashboard.js
import React, { useState, useEffect } from 'react';
import { Typography, Grid, List, ListItem, ListItemText } from '@mui/material';
import api from '../api';

const UserDashboard = () => {
  const [favorites, setFavorites] = useState([]);
  const [offers, setOffers] = useState([]);

  useEffect(() => {
    // Fetch favorite properties and offers
    const fetchUserData = async () => {
      try {
        const response = await api.get('/users/me/favorites'); // Ajusta este endpoint según sea necesario
        setFavorites(response.data.favorites);
        
        const offersResponse = await api.get('/users/me/offers'); // Ajusta este endpoint según sea necesario
        setOffers(offersResponse.data.offers);
      } catch (error) {
        console.error('Error fetching user data:', error.response?.data || error.message);
      }
    };

    fetchUserData();
  }, []);

  return (
    <Grid container spacing={3}>
      <Grid item xs={12} md={4}>
        <Typography variant="h6" gutterBottom>
          Mis Propiedades Favoritas
        </Typography>
        <List>
          {favorites.map((property) => (
            <ListItem key={property._id}>
              <ListItemText primary={property.title} />
            </ListItem>
          ))}
        </List>
      </Grid>
      <Grid item xs={12} md={4}>
        <Typography variant="h6" gutterBottom>
          Mis Ofertas
        </Typography>
        <List>
          {offers.map((offer) => (
            <ListItem key={offer._id}>
              <ListItemText primary={offer.property.title} secondary={`Estado: ${offer.status}`} />
            </ListItem>
          ))}
        </List>
      </Grid>
      <Grid item xs={12} md={4}>
        <Typography variant="h6" gutterBottom>
          Vender/Rentar Propiedad
        </Typography>
        {/* Aquí puedes agregar formularios para vender o rentar propiedades */}
      </Grid>
    </Grid>
  );
};

export default UserDashboard;
